  false,\n\t\"url\": null,\n\t\"notes\": \"In the early 1970's, the U.S. Geological
  Survey (USGS) entered into a partnership with the National Aeronautic and Space
  Administration (NASA) to provide repetitive global images of the earth's landmasses
  taken from a satellite flown at an altitude of approximately 438 miles. Onboard
  the 1999 Landsat7 satellite, the instrument used is an 8-band multispectral scanning
  radiometer that produces high-resolution images of the earth using bandwidths between
  15 and 60-meter pixel resolution.\",\n\t\"license_title\": null,\n\t\"extras\":
